        "description": "Stöld av teknisk utrustning ur bil under natten.",
        "content": "<p>07:26 Polisen larmades till området Trånghalla, Jönköping. Under natten har någon tagit sig in i en parkerad bil och tillgripit teknisk utrustning i ratten. Bilen stod parkerad utomhus i anslutning till en villa. Stölden ska ha skett någon gång mellan 19:15 igår kväll fram 07:00 i morse. Det syns inga skador utanpå bilen och det är inte känt hur tjuvarna har tagit sig in i bilen. Polisen kommer att genomföra en teknisk undersökning under förmiddagen. I nuläget finns ingen misstänkt.<br /><br />- - -</p>\n<p>Klockan 08:30 anmäldes ännu en stöld av teknsik utrustning ur bil i området Trånghalla. Även denna bil har stått parkerad utomhus i anslutning till en villa. Inte heller den här bilen har några yttre skador och det är oklart hur man har tagit sig in i bilen. Polisen kommer att genomföra en teknisk undersökning under förmiddagen.<br /><br />- - -</p>\n<p>09:06 Ytterliggare två inbrott från samma område inkom. Tillvägagångssättet är väldigt likt de tidigare stölderna. Två bilar som stod parkerade utanför en villa har fått teknisk utrustning stulen. Teknisk undersökning kommer att genomföras.</p>",
