        "title_type": "Sammanfattning natt",
        "title_location": "Östergötlands län",
        "description": "Sammanfattning av nattens händelser.",
        "content": "<p><br /> Under natten har polisen hanterat 26 händelser som rör Östergötlands län. Två personer har gripits för brott, se nedan. En person har omhändertagits för provtagning. <br /><br /> 21:50 Polisen larmades till en restaurang på Hospitalsgatan i Norrköping med anledning av ett rån. Två gärningspersoner kom in i restaurangen och tilltvingade sig kontanter av personalen. Gärningspersonerna hade vassa tillhyggen i händerna. Gärningspersonerna fick med sig en okänd summa kontanter och lämnade platsen till fots. Ingen har ännu gripits för händelsen som utreds som rån. Ingen person kom till fysisk skada. <br /><br /> 00:39 Polisen larmades till vårdcentralen i Söderköping med anledning av ett inbrottslarm. Någon hade krossat en ruta och tagit sig in i lokalerna. När polis kom fram hade gärningspersonen lämnat platsen. Det är ännu oklart om något har stulits. En anmälan om stöld genom inbrott är upprättad. <br /><br /> 01:17 Polisen larmades till försvarsmaktens övningsområde i Kvarn efter att två personer hade upptäckts innanför ett inhägnat område. Polisen anträffade två personer som hade plockat på sig tomhylsor. De greps för stöld. En anmälan om brott mot skyddslagen är också upprättad. De båda gripna är 20-årsåldern. <br /><br /> 01:23 SOS larmade polis, räddningstjänst och ambulans till E4 norrgående riktning i höjd med Tallboda efter att en lastbil hade kört av vägen och vält.  Ingen person skadades. Lastbilen har bärgats under natten. Det finns ingen misstanke om brott. <br /><br /> 04:47 Polisen larmades till Klockgjutaregatan i Norrköping med anledning av brand i bilar. Räddningstjänsten släckte branden och polisen har upprättat två anmälningar om skadegörelse genom brand. <br /><br /> 05:47 Polisen larmades till en sportbutik på Vintergatan i Motala efter att ett inbrottslarm hade utlösts. Cyklar till ett okänt värde ser ut att ha stulits. Lokalerna har spärrats av i väntan på teknisk undersökning som kommer att ske under dagen. En anmälan om stöld genom inbrott är upprättad.</p>",
