        "description": "Ett urval ur kvällen/nattens händelser i länet. Presstalespersoner i länet är Stefan Gustafsson och Anna Göransson.",
        "content": "<p><strong>Kl 21.29, Hylte, trafikolycka</strong><br />En lastbil kör av okänd anledning av vägen och hamnar i diket. Olyckan inträffar på riksväg 26 vid Örnabo mellan infarterna till Hyltebruk. Ingen personskada. Bärgare beställs till platsen som meddelar att arbetet kommer att ta flera timmar, påverkan i trafiken då trafiken måste stängas av vid bärgning. Inga brottsmisstankar.</p>\n<p><strong>Kl 03.11 Torup, dieselstöld/ två gripna</strong><br />Polis larmas till Sandslätt/Frölida där det ska pågå en dieselstöld från lastbil. En gärningsman kan nästa omgående gripas på platsen och en person uppges ha lämnat platsen till fots. Polisen söker med hund, samtidigt så anträffas en utlandsregistrerad lastbil på platsen för stölden. En hel del diesel har runnit ut på platsen så räddningstjänsten får tillkallas för sanering.  Polisen kan gripa ytterligare en misstänkt en bit från brottsplatsen. Den misstänkta lastbilen tas i beslag. Minst två lastbilar på platsen har varit utsatta för dieselstöld. De båda gripna är båda utländska medborgare.</p>",
