        "description": "Sammanfattning av nattens händelser.",
        "content": "<p>Under natten har polisen hanterat 16 händelser som rör Jönköpings län. Ingen person har gripits för brott men två personer har omhändertagits för provtagning efter misstanke på påverkan av alkohol eller narkotika. <br /><br /> 01:00 Polisen kontrollerade ett fordon på E4, Jönköping. Föraren, en man i 20-årsåldern, visade tecken på att vara påverkad av narkotika och fick följa med för provtagning. Han misstänks för rattfylleri under påverkan av narkotika. <br /><br /> 02:50 Polisen larmades till en lastbilsparkering längs med riksväg 40 i Forserum. En lastbilschaufför hade hört ljud och gick ut ur sin lastbil. Han mötte då två personer som han uppfattade försökte ta sig in i lastbilen för att stjäla. En av personerna ska då ha visat en kniv för honom och sedan sprungit från platsen. Polisen har sökt efter gärningspersonerna, bland annat med hundförare och hund, men ingen person har gripits. En anmälan om försök till grov stöld är upprättad. Ingen person har kommit till skada.</p>",
