        "content": "<p>Polispatrull observerar en bil som man beslutar sig för att kontrollera. Då patrullen vänt och kört efter bilen har bilen kört in i ett träd på Batalajonsvägen. Det finns inga uppgifter om personskador men bilen fick bärgas från platsen. Föraren, en man i 20-års åldern misstänks för drograttfylleri, vårdslöshet i trafik och olovlig körning. Passageraren, en man i 20-års åldern misstänks för ringa narkotikabrott, eget bruk.</p>",
