        "description": "Sammanfattning av nattens händelser.",
        "content": "<p>Under natten har polisen hanterat 16 händelser som rör Södermanlands län. Ingen person har gripits för brott. En person har omhändertagits för provtagning. <br /><br /> 23:23 Polisen kontaktades efter att det hörts glaskross från en restaurang på Gymnastikgatan på Eskilstuna. Någon hade kastat ett föremål genom en glasruta in till en restaurang. På plats hittade polisen det föremål som misstänks ha kastat. Föremålet togs i beslag. Då polisen misstänker att syftet var att skapa en brand i restaurangen har en utredning om försök till grov mordbrand påbörjats. Det finns flera vittnen till händelsen men i nuläget ingen misstänkt. <br /><br /> 00:57 SOS larmade räddningstjänst och polis till ett soprum på Trädgårdsgatan i Oxelösund. En mindre brand släcktes av räddningstjänsten och en anmälan om skadegörelse genom brand är upprättad. Det finns ingen misstänkt. <br /><br /> 04:00 Polisen larmades med anledning av inbrottslarm på en bilfirma på Larmvägen i Strängnäs. Fyra bilar har tillgripits. En svart Nissan GTR årsmodell 2009. En vit Mercedes-Benz AMG E63 årsmodell 2018 och en vit Porsche 991 GT3 årsmodell 2014. Värdet på dessa tre bilar uppskattas till 2.8 miljoner kronor. Bilarna är efterlysta. Uppgifter på den fjärde bilen saknas ännu. Polisen misstänker att bilarna har körts ut från bilfirman. Polisen är angelägen om att få in tips och iakttagelser från platsen för tidpunkten för brottet. Det finns i nuläget ingen misstänkt. <br />UPPDATERING 07:25: På brottsplatsen hittades en bil som inte tillhör bilfirman. Den bilen har tagits i beslag. </p>",
        "content_formatted": "<p><p>Under natten har polisen hanterat 16 händelser som rör Södermanlands län. Ingen person har gripits för brott. En person har omhändertagits för provtagning. <br /><br /> 23:23 Polisen kontaktades efter att det hörts glaskross från en restaurang på Gymnastikgatan på Eskilstuna. Någon hade kastat ett föremål genom en glasruta in till en restaurang. På plats hittade polisen det föremål som misstänks ha kastat. Föremålet togs i beslag. Då polisen misstänker att syftet var att skapa en brand i restaurangen har en utredning om försök till grov mordbrand påbörjats. Det finns flera vittnen till händelsen men i nuläget ingen misstänkt. <br /><br /> 00:57 SOS larmade räddningstjänst och polis till ett soprum på Trädgårdsgatan i Oxelösund. En mindre brand släcktes av räddningstjänsten och en anmälan om skadegörelse genom brand är upprättad. Det finns ingen misstänkt. <br /><br /> 04:00 Polisen larmades med anledning av inbrottslarm på en bilfirma på Larmvägen i Strängnäs. Fyra bilar har tillgripits. En svart Nissan GTR årsmodell 2009. En vit Mercedes-Benz AMG E63 årsmodell 2018 och en vit Porsche 991 GT3 årsmodell 2014. Värdet på dessa tre bilar uppskattas till 2.8 miljoner kronor. Bilarna är efterlysta. Uppgifter på den fjärde bilen saknas ännu. Polisen misstänker att bilarna har körts ut från bilfirman. Polisen är angelägen om att få in tips och iakttagelser från platsen för tidpunkten för brottet. Det finns i nuläget ingen misstänkt. <br />UPPDATERING 07:25: På brottsplatsen hittades en bil som inte tillhör bilfirman. Den bilen har tagits i beslag. </p></p>",
