        "description": "Gällande kl 04.06 Göteborg, trafikolycka",
        "content": "<p><br />På E6 vid Olskroksmotet i norrgående riktning mot Tingstadstunneln har en personbil kört in i en stolpe, fyra personer är i bilen. Ambulans och räddningstjänst till platsen, polis spärrar av och fordonet tas i beslag. Efter cirka en och en halv timmes avspärrning släpps trafiken på igen. <br />Polisen kan inte utala sig om skadeläget innan polisens utredningstekniska åtgärder är klara, detta gäller samtlig fyra inblandade i olyckan.  </p>\n<p><strong>Uppdatering kl 15.30:</strong><br />Samtliga fyra personer som färdades i bilen är avlidna, de fyra var i 20-årsåldern. Underrättelsearbetet med anhöriga pågår. En anmälan om trafikolycka med brottsrubrik grov vårdslöshet i trafik är upprättad för att polis skall kunna vidta polisiära åtgärder.</p>\n<p><strong>Övrigt:</strong> Okänd person har filmat olycksplatsen på mycket nära håll innan ambulans och polis kommit till platsen, denna film har sedan lagts ut på sociala medier. Polis har upprättat en anmälan med rubrik olaga integritetsintrång.   </p>\n\n",
