        "description": "Uppdatering gällande branden på Mariehem i Umeå.",
        "content": "<p>Under söndagen fortsätter polisens utredningsarbete efter branden på Mariehemsvägen i Umeå. Bland annat fortsätter polisen under dagen att knacka dörr i området.</p>\n<p>Under lördagen utfördes också en teknisk undersökning av brandplatsen. Resultatet av den är inte klar, men väntas under kommande vecka.</p>\n<p>De tips som har kommit in gällande branden ska också följas upp.</p>\n<p><strong>Polisen är dock fortsatt intresserade av att få in iakttagelser som kan sättas i samband med branden eller tips gällande densamma. Ring polisen på telefonnummer 114 14.</strong></p>\n<p>Det var strax efter klockan 22.00 på fredagskvällen som polisen larmades om en brand i en carportlänga i höjd med Mariehemsvägen 31 på Mariehem. Cirka 50 bilar skadades i branden.</p>\n<p>En förundersökning är inledd gällande grov mordbrand då polisen misstänker att branden är anlagd, bland annat på grund av det hastiga brandförloppet.</p>\n",
