        "description": "Sammanfattning av nattens polisverksamhet i polisområde Södermanland.",
        "content": "<p>07.18 polisen har hittills detta dygn hanterat ett 50-tal rutinärenden, huvudsakligen utan brottsmisstankar. Ingen har gripits, fem har omhändertagits för berusning/ordningsstörning och tre har fått följa med för provtagning på grund av misstänkt drogpåverkan.</p>\n<p>00.57 vid en rutinmässig kontroll av en bilist i Oxelösund uppstod misstanke om drograttfylleri och en man i 215-årsåldern fick följa med för provtagning och förhör. Han frigavs efter förhöret.</p>\n<p>01.30 polisen kallades till en restaurang på Östra Storgatan i Nyköping med anledning av misshandel. Polisen åpkte till platsen och träffade på två personer båda män i 20- resp. 25-årsåldern som ville anmäla varandra för misshandel varför två utredningar om misshandel påbörjades. En av dem avlägsnades från platsen av polisen men ingen frihetsberöävades.</p>\n<p>02.15 trafikolycka på Selaön i Strängnäs. En man som kört fyrhjuling och kört in i en mur. Polisen åkte till platsen och mannen som kört fördes till sjukhus med ambulans. Polisen följde med till sjukhuset och tog blodprov på mannen, som är i 55-årsåldern, eftersom han misstänks för rattfylleri. Skadeläget är oklart.</p>\n<p>Det finns inga andra brott eller allvarliga händelser att rapportera om.</p>\n\n\n",
