        "content": "<p>07.37 polisen har hittills detta dygn hanterat ett 55-tal rutinärenden, huvudsakligen utan brottsmisstankar. Ingen har gripits, nio har omhändertagits för berusning/ordningsstörning och tre har fått följa med för provtagning på grund av misstänkt drogpåverkan.</p>\n<p>01.07 polisen kallades till S:t Persgatan i Norrköping med anledning av att en person skulle ha skadat sig. Polisen åkte till platsen och påbörjade en utredning om grov misshandel, eftersom det finns misstanke om att mannen, som är i 30-årsåldern kan ha tillfogats skadorna med ett vasst föremål. Det finns inledningsvis ingen misstänkt. Mannen fördes till sjukhus med ambulans med kraftiga sårskador på överkroppen.</p>\n<p>Det finns inga andra brott eller allvarliga händelser att rapportera om.</p>\n\n\n\n\n\n",
