        "title_location": "Jönköpings län",
        "description": "Sammanfattning av nattens polisverksamhet i polisområde Jönköping.",
        "content": "<p>07.55 polisen har hittills detta dygn hanterat ett 55-tal rutinärenden, huvudsakligen utan brottsmisstankar. Två personer har gripits för brott, åtta har omhändertagits för berusning/ordningsstörning och fem har fått följa med för provtagning på grund av misstänkt drogpåverkan.</p>\n<p>00.46 vid en rutinkontroll av en bilist på E4 Vaggeryd uppstod misstanke om rattfylleri. En man i 40-årsåldern fick följa med för provtagning och förhör. Frigavs efter förhör.</p>\n<p>01.54 samtal till polisen om att en man skulle ha blivit misshandlad i Gislaved. Polisen åkte till platsen och påbörjade en utredning om grov misshandels med anledning av att en man ska ha blivit misshandlad med ett tillhygge. Två män i 25- respektive 30-årsåldern hämtades in till förhör och efter förhöret blev båda två anhållna av åklagare, på sannolika skäl misstänkta för grov misshandel och övergrepp i rättssak.</p>\n<p>De båda misstänkta personerna är även misstänkta för ett annat fall av försök till grov misshandel i Gislaved som ska ha inträffat undefär vid 03-tiden.</p>\n<p>06.58 samtal till polisen om att en bilägare fått sin bil stulen under natten i Vetlanda. Den stulna bilen är en svart BMW 520, som nu är efterlyst och efterspanad.</p>\n<p>Det finns inga andra brott eller allvarliga händelser att rapportera om.</p>\n\n\n\n\n\n\n",
        "content_formatted": "<p><p>07.55 polisen har hittills detta dygn hanterat ett 55-tal rutinärenden, huvudsakligen utan brottsmisstankar. Två personer har gripits för brott, åtta har omhändertagits för berusning/ordningsstörning och fem har fått följa med för provtagning på grund av misstänkt drogpåverkan.</p></p><p><p>00.46 vid en rutinkontroll av en bilist på E4 Vaggeryd uppstod misstanke om rattfylleri. En man i 40-årsåldern fick följa med för provtagning och förhör. Frigavs efter förhör.</p></p><p><p>01.54 samtal till polisen om att en man skulle ha blivit misshandlad i Gislaved. Polisen åkte till platsen och påbörjade en utredning om grov misshandels med anledning av att en man ska ha blivit misshandlad med ett tillhygge. Två män i 25- respektive 30-årsåldern hämtades in till förhör och efter förhöret blev båda två anhållna av åklagare, på sannolika skäl misstänkta för grov misshandel och övergrepp i rättssak.</p></p><p><p>De båda misstänkta personerna är även misstänkta för ett annat fall av försök till grov misshandel i Gislaved som ska ha inträffat undefär vid 03-tiden.</p></p><p><p>06.58 samtal till polisen om att en bilägare fått sin bil stulen under natten i Vetlanda. Den stulna bilen är en svart BMW 520, som nu är efterlyst och efterspanad.</p></p><p><p>Det finns inga andra brott eller allvarliga händelser att rapportera om.</p></p><p></p>",
