        "description": "Ett urval av nattens polisverksamhet mellan klockan 00.00-07.00.",
        "content": "<p>Fyra personer har omhändertagits för fylleri. Polisen har även utfört ett flertal kontroller av personer och fordon som inte resulterat i någon brottsmisstanke.</p>\n<p>Här följer ett urval av nattens händelser:</p>\n<p><strong>01:55 Misshandel, Umeå</strong><br />Polisen beordras till en restaurang i centrala Umeå med anledning av ett bråk. En man i 25-årsåldern är misstänkt för att ha misshandlat en några år yngre man. Den misstänkte avvisas från restaurangen. Polisen tar upp en anmälan om misshandel.</p>\n<p><strong>02:36 Våldsamt motstånd, Umeå</strong><br />Polisen stoppar och ska kontrollera en personbil på Teg. Föraren kliver då ur bilen och är så arg att polisen till sist måste belägga honom med handfängsel. En anmälan om våldsamt motstånd upprättas. Den misstänkte är en man i 30-årsåldern.</p>\n<p><strong>03:41 Trafikolycka, Skellefteå</strong><br />Polisen möter en personbil på länsväg 816 utanför Skellefteå. Patrullen beslutar sig för att vända och kontrollera bilen. När de passerar nästkommande kurva ligger aktuellt fordon på taket på en tomt. Bilen har gått av vägen, kört igenom ett bullerplank och slutat färden inne på en tomt. Ambulans tillkallas, mannen klagade bland annat på smärta i en fot.</p>\n<p>Provtagning visar att mannen är påverkad av alkohol, en anmälan om grovt rattfylleri upprättas.</p>\n",
