        "description": "God morgon, dagens presstalesperson heter Ulla Brehm.",
        "content": "<p><strong>00.17 Göteborg, misshandel<br /></strong>Polis larmas till en lekplats på Tallgården angående sex män som är inblandade i ett bråk. En man är knivskuren i ett ben, en annan kraftigt slagen. Ambulans kallas till platsen. Inga gärningsmän finns kvar på platsen, polis med hund söker i området utan resultat. Flera vittnen hörs, ingen av de skadade åker med ambulans till sjukhus. Anmälan gällande misshandel skrivs.</p>\n<p><strong>01.34 Göteborg, skadegörelse</strong><br />Ett vittne ser hur en man krossar rutor på en busskur på Chapmans Torg, han går senare på en spårvagn. Polispatrull kan stoppa vagnen och omhänderta mannen som är kraftigt berusad. En anmälan om skadegörelse skrivs.</p>\n<p><strong>04.06 Göteborg, trafikolycka</strong><br />På E6 vid Olskroksmotet i norrgående riktning mot Tingstadstunneln har en personbil kört in i en stolpe, fyra personer är i bilen. Ambulans och räddningstjänst till platsen, polis spärrar av och fordonet tas i beslag. Efter cirka en och en halv timmes avspärrning släpps trafiken på igen. <br />Polisen kan inte utala sig om skadeläget innan polisens utredningstekniska åtgärder är klara, detta gäller samtlig fyra inblandade i olyckan.  </p>",
