        "description": "Fyra män grips misstänkta för grov misshandel.",
        "content": "<p>Polis larmas till Möllevångstorget med anledning av en pågående misshandel. Händelsen startar med att en man blir misshandlad. När tre förbipasserande män ser misshandeln börjar de misshandla den första gärningsmannen. Polis beordras till platsen och är snabbt på plats. Möllevångstorget är kameraövervakat och med hjälp av filmmaterialet kunde polisen enkelt identifiera vad som hänt och vem som misstänks vara gärningspersoner. Den man som först blir misshandlad och den misshandlade gärningsmannen förs med ambulans till sjukhus och kan senare lämna sjukhuset. Totalt är fyra personer gripna, samtliga män i 20-årsåldern, misstänkta för grov misshandel.  </p>\n",
