        "description": "Brand i flerfamiljshus.",
        "content": "<p>Det brinner i en lägenhet på Rödkullastigen och polis, ambulans och räddningstjänst larmas till platsen. Branden misstänks ha startat på balkongen och sedan spridit sig in i lägenheten. Fastigheten utryms under släckningsarbetet och ingen person uppges ha kommit till skada i samband med branden. Vid 03-tiden var branden släckt och de boenden kunde återvända till sina lägenheter. Exakt hur branden startat är i nuläget oklart och lägenheten spärras av i avvaktan på teknisk undersökning. Polisen rubricerar händelsen som mordbrand.</p>\n",
