        "description": "Ett urval av nattens polisverksamhet klockan 00.00-07.00.",
        "content": "<p>Fem personer har omhändertagits för fylleri, en av dem misstänks även för ringa narkotikabrott. Ytterligare en person har medtagits för provtagning efter misstanke om narkotikabrott.</p>\n<p>Polisen har även utfört ett flertal kontroller av personer och fordon som inte resulterat i någon brottsmisstanke.</p>\n<p>Här följer ett urval av nattens händelser:</p>\n<p><strong>01:25 Ofredande, Piteå</strong><br />Polisen kontaktas gällande ett bråk utomhus i centrala Piteå. En man uppges att han har blivit upptryckt mot en vägg av en annan man. Patrullen åker dit och pratar med målsäganden, en anmälan om ofredande upprättas.</p>\n<p><strong>01:40 Bedrägligt beteende, Luleå</strong><br />Polisen kontaktas gällande en taxichaufför som inte ska ha fått betalt av tre personer som han har kört. De misstänkta har lämnat platsen när polisen kommer dit. En anmälan upprättas gällande bedrägligt beteende.</p>\n<p><strong>01:53 Inbrott, Malmberget</strong><br />Polisen kontaktas gällande att ett inbrottslarm gått på en bensinmack i Malmberget, Gällivare. En ruta är krossad på fastigheten och varor har tillgripits, det är dock oklart vad ännu. Polisen genomsöker lokalen och omgivningen men utan att påträffa den misstänkte gärningspersonen/personerna. En brottsplatsundersökning ska genomföras.</p>\n<p><strong>Övrigt:</strong> Två viltolyckor har inträffat under natten, en i Kalix kommun samt en i Luleå. Det finns inga uppgifter om att någon person har kommit till skada.</p>",
