        "description": "Ett urval av nattens händelser i länet",
        "content": "<p><strong>23:34 - Grovt rattfylleri, Norrmalm, Sundsvall</strong></p>\n<p>Polis försöker stoppa och kontrollera en personbil men föraren väljer att inte stanna. Ett kortare förföljande inleds innan polis kan stoppa bilen. Föraren, en man i 40-årsåldern, medtas till provtagning misstänkt för rattfylleri och för att inte ha stannat på polismans tecken.</p>\n<p>Vid provtagningen visar värdet på grovt rattfylleri. Polis skriver anmälan och omhändertar mannens körkort.</p>\n<p><strong>01:54 - Rattfylleri, Gullänget, örnsköldsvik</strong></p>\n<p>Polis stoppar och kontrollerar en personbil och dess förare som kört vingligt. Vid kontrollen uppstår misstanke om att föraren, en man i 20-årsåldern, är påverkad av narkotika. Mannen medtas till provtagning och förhörs. Polis skriver en anmälan gällande drograttfylleri.</p>\n<p><strong>03:50 - Skadegörelse, Sollefteå</strong></p>\n<p>Polis kallas till en adress i Sollefteå då en person uppmärksammat några ungdomar som varit och förstört saker på en tomt. Polis skriver en anmälan gällande skadegörelse då bl.a. en postlåda har slagits sönder. Polis lyckas inte lokalisera några ungdomar.</p>\n<p>Det har varit en natt med normal arbetsbelastning där polisen även har utfört ett flertal kontroller av personer och fordon som inte har resulterat i någon brottsmisstanke. </p>",
        "content_formatted": "<p><p><strong>23:34 - Grovt rattfylleri, Norrmalm, Sundsvall</strong></p></p><p><p>Polis försöker stoppa och kontrollera en personbil men föraren väljer att inte stanna. Ett kortare förföljande inleds innan polis kan stoppa bilen. Föraren, en man i 40-årsåldern, medtas till provtagning misstänkt för rattfylleri och för att inte ha stannat på polismans tecken.</p></p><p><p>Vid provtagningen visar värdet på grovt rattfylleri. Polis skriver anmälan och omhändertar mannens körkort.</p></p><p><p><strong>01:54 - Rattfylleri, Gullänget, örnsköldsvik</strong></p></p><p><p>Polis stoppar och kontrollerar en personbil och dess förare som kört vingligt. Vid kontrollen uppstår misstanke om att föraren, en man i 20-årsåldern, är påverkad av narkotika. Mannen medtas till provtagning och förhörs. Polis skriver en anmälan gällande drograttfylleri.</p></p><p><p><strong>03:50 - Skadegörelse, Sollefteå</strong></p></p><p><p>Polis kallas till en adress i Sollefteå då en person uppmärksammat några ungdomar som varit och förstört saker på en tomt. Polis skriver en anmälan gällande skadegörelse då bl.a. en postlåda har slagits sönder. Polis lyckas inte lokalisera några ungdomar.</p></p><p><p>Det har varit en natt med normal arbetsbelastning där polisen även har utfört ett flertal kontroller av personer och fordon som inte har resulterat i någon brottsmisstanke. </p></p>",
