        "content": "<p><strong>19:07 - Knivlagen, fritidsgård, Östersund</strong></p>\n<p>Polis kallas till en fritidsgård då uppgifter inkommit om att det ska förekomma bråk och även finnas tillhyggen på platsen.</p>\n<p>På platsen befinner sig många ungdomar och polis tvingas avbryta flertalet bråk. Då det finns uppgifter om tillhyggen visiteras och identifieras ungdomarna på platsen. I samband med detta anträffas tillhyggen som klassas som gatustridsvapen inne på fritidsgården.</p>\n<p>Polis avvisar ungdomarna från fritidsgården. Personal på fritidsgården tog efter detta beslut om att stänga fritidsgården för kvällen. Polis skriver anmälningar gällande brott mot knivlagen och förberedelse till misshandel.</p>\n<p><strong><strong>21:28 - Rattfylleri, E14/E45 Brunflo</strong></strong></p>\n<p>Polis försöker stoppa och kontrollera en personbil. Föraren stannar inte och ett förföljande inleds. Efter några minuter kan polis få stopp på bilen. Föraren, en man i 40-årsåldern, blir misstänkt för rattfylleri och för att inte ha stannat på polismans tecken.</p>\n<p>Föraren medtas till provtagning och en anmälan angående bl.a. rattfylleri upprättas.</p>\n<p><strong>00:12 - Misshandel, centrala Östersund</strong></p>\n<p>Polis kallas till en restaurang i centrala Östersund med anledning av en misshandel. Det visar sig vara en kvinna som blivit knuffad av en man i 50-årsåldern. Polis skriver en anmälan gällande misshandel.</p>\n<p><strong>01:14 - Misshandel, centrala Östersund</strong></p>\n<p>Polis kallas till en restaurang i centrala Östersund med anledning av en misshandel. På plats visar det sig vara en kvinna som vill anmäla att hon blivit misshandlad av en annan kvinna. Det finns inga uppgifter om att någon behövt omplåstring. Polis skriver en anmälan gällande misshandel.</p>\n<p>Sammanfattning: det har varit en natt med normal arbetsbelastning där polisen även har utfört ett flertal kontroller av personer och fordon som inte har resulterat i någon brottsmisstanke.</p>\n",
