        "description": "En person anträffad svårt skadad efter larm om skottlossning.",
        "content": "<p>20.26 Polisen tog emot samtal gällande en misstänkt skottlossning som skulle ha sett i området Skäggetorp. Flera patruller åkte till platsen.</p>\n<p>När polisen kom till platsen anträffades en person, mycket allvarligt skadad.</p>\n<p>Polisen har spärrat av i området med anledning av att ett grovt brott har skett.</p>\n<p>Just nu arbetar ett flertal polispatruller på platsen.</p>\n<p><strong>Uppdatering:</strong></p>\n<p>Den skadade personen, en man i 20-årsåldern, skadades så allvarligt att han avled av sina skador. Anhöriga har underrättats.</p>\n<p>En förundersökning gällande mord har inletts. Polisen har, och kommer att genomföra, sedvanliga utredningsåtgärder med anledning av att ett grovt brott har skett.</p>\n<p>Polisen har bland annat hållit ett antal förhör med personer på platsen och i området. Avspärrningarna kommer att kvarstå till dess att tekniker är klara med sitt arbete på brottsplatsen.</p>\n<p>Det finns i nuläget inga uppgifter om anledningen till brottet.</p>\n<p>Polisen är angelägen att komma i kontakt med vittnen eller andra som gjort iakttagelser. Vittnen ombeds att ta kontakt med polisen på plats eller ringa 114 14.</p>\n<p>Inga ytterligare uppgifter kommer att lämnas i ärendet under natten.</p>\n<p><strong>Uppdatering 2020-02-16, 08.30: </strong>Utredningsarbetet fortsätter under dagen. Det finns ingen frihetsberövad i utredningen och någon ny information finns för närvarande inte.</p>",
        "content_formatted": "<p><p>20.26 Polisen tog emot samtal gällande en misstänkt skottlossning som skulle ha sett i området Skäggetorp. Flera patruller åkte till platsen.</p></p><p><p>När polisen kom till platsen anträffades en person, mycket allvarligt skadad.</p></p><p><p>Polisen har spärrat av i området med anledning av att ett grovt brott har skett.</p></p><p><p>Just nu arbetar ett flertal polispatruller på platsen.</p></p><p><p><strong>Uppdatering:</strong></p></p><p><p>Den skadade personen, en man i 20-årsåldern, skadades så allvarligt att han avled av sina skador. Anhöriga har underrättats.</p></p><p><p>En förundersökning gällande mord har inletts. Polisen har, och kommer att genomföra, sedvanliga utredningsåtgärder med anledning av att ett grovt brott har skett.</p></p><p><p>Polisen har bland annat hållit ett antal förhör med personer på platsen och i området. Avspärrningarna kommer att kvarstå till dess att tekniker är klara med sitt arbete på brottsplatsen.</p></p><p><p>Det finns i nuläget inga uppgifter om anledningen till brottet.</p></p><p><p>Polisen är angelägen att komma i kontakt med vittnen eller andra som gjort iakttagelser. Vittnen ombeds att ta kontakt med polisen på plats eller ringa 114 14.</p></p><p><p>Inga ytterligare uppgifter kommer att lämnas i ärendet under natten.</p></p><p><p><strong>Uppdatering 2020-02-16, 08.30: </strong>Utredningsarbetet fortsätter under dagen. Det finns ingen frihetsberövad i utredningen och någon ny information finns för närvarande inte.</p></p>",
        "content_teaser": "20.26 Polisen tog emot samtal gällande en misstänkt skottlossning som skulle ha sett i området Skäggetorp. Flera patruller åkte till platsen. \n När polisen kom...",
