        "description": "SOS har fått larm till Bagarmossen om att en person ska ha blivit knivskuren. Ingen gärningsperson ska vara kvar.",
        "content": "<p>Patrull är snabbt på plats och har kontakt med målsäganden som är vaken och talbar. Ambulans är också på plats och den skadade kommer att föras till sjukhus.</p>\n<p>Patrull kommer att åka till sjukhuset för att höra målsäganden vidare.</p>\n<p>Andra patruller är på plats och söker gärningspersoner som enligt initiala uppgifter har lämnat till fots. De kommer även att knacka dörr i närliggande fastigheter.</p>\n<p>Initialt är brottsrubriceringen försök till dråp.</p>\n<p><strong>Uppdatering klockan 21:50</strong></p>\n<p>Utredningsarbetet fortsätter på platsen med bl.a.dörrknckning.</p>\n<p>Läget för den skadade är stabilt och patrull är på sjukhuset för att höra honom vidare. Ingen är gripen i ärendet och brottsrubriceringen kvarstår. </p>",
