        "description": "Ett grovt brott utreds på Bäckby centrum.",
        "content": "<p>Med anledning av att ett grovt brott utreds på Bäckby centrum har polisen en närvaro på platsen. Avspärrningar har upprättas på adressen. Notisen kommer att uppdateras.</p>\n<p><strong>Uppdatering 13:35</strong></p>\n<p>Vid 10-tiden inkom ett larm om ett rån på en butik i Bäckby centrum. Två personer ska ha utfört rånet, lämnat kvar ett misstänkt farligt föremål och sedan lämnat platsen i en bil.</p>\n<p>Polis tillkallas och spärrar av samt utrymmer Bäckby centrum, för att ingen risk ska föreligga för allmänheten. Ingen person har kommit till skada. Nationella bombskyddet kopplas in för att undersöka det misstänkt farligt föremålet.</p>\n<p>Händelsen rubriceras som grovt rån och förberedelse till allmänfarlig ödeläggelse.</p>\n<p>Ingen person är gripen i ärendet.</p>\n\n\n\n",
