        "description": "Två greps på bar gärning i hus.",
        "content": "<p>09.43 samtal till polisen om att två personer hade setts smyga runt och gå in i ett hus i Gislaved. En av tjuvarna ska ha klättrat in genom ett fönster och sedan öppnat dörren inifrån åt den andre.</p>\n<p>10.03 polisen är framme vid huset och börjat ta reda på vad som hänt.</p>\n<p>10.13 polisens hundpatrull är framme på platsen och patrullhunden skickas in för att söka efter obehöriga.</p>\n<p>10.20 två män i 50- respektive 60-årsåldern är nu gripna inne i huset.</p>\n<p>11.51 polisen har påbörjat en utredning om stöld genom inbrott (stöld av normalgraden efterson huset hust nu är obebott). De misstänkta har inte lyckats stjäla något men de misstänks ha gjort iordning föremål i transportabelt skick för att ta med sig.</p>\n<p>De gripna förs till polisstationen för förhör varefter åklagare kommer att fatta beslut om den fortsatta förundersökningen. Två cyklar som tjuvarna åkte på tas i beslag. De antas vara stulna och polisen påbörjar två utredningar om stöld alternativt häleri.</p>\n<p>Polisen uppmanar personer i Gislaved som fått cyklar stulna att göra anmälan om brottet.</p>\n\n\n",
