        "content": "<p>Tre personer har omhändertagits för fylleri i Västerbottens län under natten, två av dessa misstänks också för ringa narkotikabrott. Ytterligare en person har medtagits för provtagning efter misstanke om narkotikabrott. Polisen har även utfört ett flertal kontroller av personer och fordon som inte resulterat i någon brottsmisstanke.</p>\n<p>Här följer ett urval av nattens händelser:</p>\n<p><strong>00:40 Misshandel, Skellefteå</strong><br />Polisen beordras till en adress i Skellefteå med anledning av en misshandel. En man i 50-årsåldern grips misstänkt för att ha misshandlat en kvinna som han har en relation till. Mannen anhålls efter förhör.</p>\n<p><strong>01:43 Stöld, Skellefteå</strong><br />Polisen kontaktas angående att flera gärningsmän ses göra åverkan på en betalstation vid en bensinmack i Skellefteå. Männen lämnar sedan platsen. Polisen åker dit och utför en spårsäkring. En anmälan gällande stöld upprättas.</p>\n<p><strong>01:59 Våld mot tjänsteman, Umeå</strong><br />I samband med att en ordningsvakt ska avvisa en man från ett uteställe i Umeå ska mannen ha gjort motstånd och varit utåtagerande mot vakten. Polisen åker dit och tar upp en anmälan om våldsamt motstånd samt våld mot tjänsteman.</p>\n<p><strong>03:18 Olaga intrång, Vilhelmina.</strong><br />Två personer är misstänkta för att olovligen ha tagit sig in i en kur tillhörande ordningsvakter i centrala Vilhelmina. Polisen har varit på plats och tagit upp en anmälan gällande olaga intrång.</p>\n<p><strong>Övrigt:</strong> Två viltolyckor har inträffat i Umeå kommun under natt och tidig morgon. Det finns inga uppgifter om att några personskador har uppkommit.</p>\n",
