        "description": "Sammanfattning av nattens polisverksamhet i polisområde Östergötland.",
        "content": "<p>07.40 polisen har hittills detta dygn hanterat ett 65-tal rutinärenden, huvudsakligen utan brottsmisstankar. En person har gripits, 12 har omhändertagits för berusning/ordningsstörning och fyra har fått följa med för provtagning och förhör med anledning av misstnkt drogpåverkan.</p>\n<p>00.03 SOS-larm om trafikolycka på Borensvägen i Motala. En cyklist som cyklat in i en stolpe fördes till sjukhus med ambulans.Det var en man i 40-årsåldern och skadeläget är oklart. Ingen misstanke om brott.</p>\n<p>00.13 väktare ringde polisen om att ett inbrott hade upptäckts på Svärmaregatan i Norrköping. Någon har klippt upp ett staket och sedan gjort inbrott, men det är ännu okänt vad som stulits. Polisen har påbörjat en utredning om stöld genom inbrott utan någon misstänkt.</p>\n<p>00.47 polisen blev kallad till en bostad i Finspång med anledning av en misshandel. När polisen kom fram träffade de på en kvinna som hade utsatts för misshandel av en man hon har en relation med. Båda två är i 60-årsåldern och mannen kunde gripas på platsen, misstänkt för misshandel i relation. Mannen kommer att förhöras efter att han tillnyktrat.</p>\n<p><strong>Uppdatering 12.10: </strong>den misstänkte mannen har förhörts under morgonen och sedan anhållits av åklagare men vid lunchtid hävde åklagaren anhållningsbeslutet och den misstänkte mannen är nu frigiven efter att de utredningsåtgärder som krävde frihetsberövande nu är genomförda.</p>\n<p>01.59 inbrottslarm från en livsmedelsbutik i Vilbergen, Norrköping. Det visade sig att någon har krossat en glasruta och därefter krupit genom hålet. När polisen sökte genom lokalerna med hund fanns ingen person kvar. Polisen har påbörjat en utredning om stöld genom inbrott. Oklart om något har stulits.</p>\n<p>Det finns inga andra brott eller allvarliga händelser att rapportera om.</p>\n\n\n\n",
