        "description": "Sammanfattning av nattens polisverksamhet i polisområde Södermanland.",
        "content": "<p>07.20 polisen har hittills detta dygn hanterat ett 45-tal rutinärenden, huvudsakligen utan brottsmisstankar. Ingen har gripits, fem har omhändertagits och sju har fått följa med för provtagning på grund av misstänkt drogpåverkan.</p>\n<p>00.48 vid en rutinmässig kontroll av en mopedist på Ridderhofsgatan i Eskilstuna  uppstod misstanke om drograttfylleri och en man i 50-årsåldern fick följa med för provtagning och förhör. Han blev även misstänkt för ringa narkotikabrott genom eget bruk.</p>\n<p>02.56 Vid en rutinmässig kontroll av en bilist på Brunnsgatan i Nyköping uppstod misstanke om rattfylleri och en man i 25-årsåldern fick följa med för provtagning och förhör.</p>\n<p>Det finns inga andra brott eller allvarliga händelser att rapportera om.</p>",
