        "content": "<p>Det har varit en natt med normal arbetsbelastning. Två personer har omhändertagits för fylleri och en person har medtagits för provtagning efter misstanke om narkotikabrott, bruk samt innehav. Polisen har även utfört ett flertal kontroller av personer och fordon som inte resulterat i någon brottsmisstanke.</p>\n<p><strong>Här följer ett urval av nattens händelser:</strong></p>\n<p><strong>23:33 Grov misshandel, Östersund</strong><br />Polisen kontaktas angående ett bråk på Rådhusgatan i centrala Östersund. En man i 18-årsåldern har blivit misshandlad av flera gärningsmän, gärningen rubriceras grov misshandel. Mannen förs med ambulans till sjukvård för kontroll. Han ska inte vara allvarligt skadad.</p>\n<p>Gärningsmännen lämnade platsen men påträffades av polis kort därefter. Fyra personer grips misstänkta för brottet.</p>\n\n<p><strong>Övrigt:</strong> En viltolycka har inträffar under tidig morgon, i Bräcke kommun. Det finns inga uppgifter om personskador.</p>",
