        "description": "Bilist vägrade stanna - trodde inte poliserna var riktiga",
        "content": "<p>En bilist vägrade stanna i samband med att en patrull försökte stoppa ett fordon för en kontroll på länsväg 288 utanför Uppsala. Ett så kallat förföljande inleddes som pågick i cirka 10 minuter innan föraren, en 58-årig kvinna, stannade strax utanför Vallby. Flertalet patruller var inblandade i förföljandet.</p>\n<p>Förarens förklaring till att hon inte stannade var för att trodde att det var falska poliser då hon tyckte att blåljusen såg falska ut. Hon trodde att de \"falska\" poliserna var ute efter att råna henne.</p>\n<p>En anmälan om att ej stannat på polismans tecken är upprättad. Att ej stanna på polismans tecken är ett brott mot trafikförordningen och påföljden är penningböter.</p>\n",
