        "description": "Airbags och rattar stulna ur ett flertal Volvobilar.",
        "content": "<p>Under fredagen har polisen tagit emot ett tiotal anmälningar gällande inbrott i bilar. De flesta av anmälningarna gäller inbrott i Volvobilar av modell XC60 och V90. Ytterligare en anmälan har kommit in gällande stöld ur en BMW. Det som har stulits är airbags och rattar.</p>\n<p>Inbrotten i bilarna ska ha skett någon gång under natten och upptäckts på morgonen/förmiddagen. I samtliga fall var larm installerade i bilarna men inga larm utlöste vid inbrotten. De olika brottsplatserna ligger i närheten av varandra.</p>\n<p>I samtliga fall ska inbrotten ha skett utan åverkan på bilen. Polisen misstänker därför att stölderna skett genom att någon eller några personer använt relämetoden och öppnat bildörren efter att första ha fångat nyckelsignalen från bilägarens bostad.</p>\n<p>Under natten mellan onsdag och torsdag stals rattar och airbags, enligt samma tillvägagångssätt, i Växjöområdet.</p>\n<p>Polisen uppmanar bilägare att vara uppmärksamma på den här typen av stölder.</p>\n<p><strong>Så kan du försvåra för tjuven:</strong></p>\n<p>* Parkera din bil i ett garage.<br />* Förvara din bilnyckel i en plåtburk och/eller inlindad i folie.<br />* Håll uppsikt över din bil.</p>\n<p>Polisen är mycket intresserad av tips och iakttagelser med anledning av stölderna. Har du gjort iakttagelser – ring polisen på 114 14.</p>",
        "content_formatted": "<p><p>Under fredagen har polisen tagit emot ett tiotal anmälningar gällande inbrott i bilar. De flesta av anmälningarna gäller inbrott i Volvobilar av modell XC60 och V90. Ytterligare en anmälan har kommit in gällande stöld ur en BMW. Det som har stulits är airbags och rattar.</p></p><p><p>Inbrotten i bilarna ska ha skett någon gång under natten och upptäckts på morgonen/förmiddagen. I samtliga fall var larm installerade i bilarna men inga larm utlöste vid inbrotten. De olika brottsplatserna ligger i närheten av varandra.</p></p><p><p>I samtliga fall ska inbrotten ha skett utan åverkan på bilen. Polisen misstänker därför att stölderna skett genom att någon eller några personer använt relämetoden och öppnat bildörren efter att första ha fångat nyckelsignalen från bilägarens bostad.</p></p><p><p>Under natten mellan onsdag och torsdag stals rattar och airbags, enligt samma tillvägagångssätt, i Växjöområdet.</p></p><p><p>Polisen uppmanar bilägare att vara uppmärksamma på den här typen av stölder.</p></p><p><p><strong>Så kan du försvåra för tjuven:</strong></p></p><p><p>* Parkera din bil i ett garage.<br />* Förvara din bilnyckel i en plåtburk och/eller inlindad i folie.<br />* Håll uppsikt över din bil.</p></p><p><p>Polisen är mycket intresserad av tips och iakttagelser med anledning av stölderna. Har du gjort iakttagelser – ring polisen på 114 14.</p></p>",
