        "title_type": "Försvunnen person",
        "title_location": "Härjedalen",
        "description": "Uppdatering angående den försvunne pojken i Herrö, Väster om Sveg.",
        "content": "<p>Pojken, som är i övre tonåren, är fortfarande försvunnen.</p>\n<p>Vid försvinnandet vid 20-tiden på torsdagen bar han en brun täckjacka med kapuschong, svarta täckbyxor, svarta vantar och glasögon. Han är cirka 188 centimeter lång och har en smal kroppsbyggnad. Polisen har letat med flera patruller under natten. </p>\n<p>På fredag morgon inledde vakthavande LSO, Lagen om skydd mot olyckor.</p>\n<p>En helikopter är på väg för att eventuellt delta i arbetet med att leta efter pojken.</p>\n<p>Uppdatering 09:46<br />Både fjällräddare och polisens EFP-grupp i Jämtland kallas på för att delta i arbetet. EFP är polisens arbetsmetod Efterforskning av försvunna personer.</p>\n<p>Uppdatering 10:11<br />Enligt uppdaterat signalement så bar han inte glasögon vid försvinnandet. <br />En helikopter söker från luften.</p>\n<p><strong>Uppdatering 15:24:</strong></p>\n<p>Polisen dimensionerar resurserna för att på bästa sätt undsätta den försvunne. Vädret på plats är vackert, men kallt, och detta betyder att polisen måste ha rätt folk på rätt plats för att sökandet ska bli effektivt.</p>\n<p>Polisen samarbetar med frivilligorganisationer och har en mycket god kontakt med Missing People. Sökandet sker både på mark och från luften. Försvaret är kontaktat och fjällräddare finns på plats.</p>\n<p>Nya färska hundekipage från både fjällräddning och polisen är på väg.</p>\n<p>Det finns vissa spår som man arbetar med och polisen kommer att gå ut med mer information när sådan finns att ge eftersom polisen behöver allmänhetens hjälp.</p>\n<p><strong>Uppdatering 19:15:</strong></p>\n<p>Den försvunne är återfunnen avliden. Anhöriga är underrättade.</p>\n<p>Polisen misstänker inget brott i samband med dödsfallet.</p>\n<p>Polisen tackar alla som hjälpt till i sökandet.</p>\n<p>Uppdatering av Åsa Mjörndal, RLC-kommunikatör</p>",
        "content_formatted": "<p><p>Pojken, som är i övre tonåren, är fortfarande försvunnen.</p></p><p><p>Vid försvinnandet vid 20-tiden på torsdagen bar han en brun täckjacka med kapuschong, svarta täckbyxor, svarta vantar och glasögon. Han är cirka 188 centimeter lång och har en smal kroppsbyggnad. Polisen har letat med flera patruller under natten. </p></p><p><p>På fredag morgon inledde vakthavande LSO, Lagen om skydd mot olyckor.</p></p><p><p>En helikopter är på väg för att eventuellt delta i arbetet med att leta efter pojken.</p></p><p><p>Uppdatering 09:46<br />Både fjällräddare och polisens EFP-grupp i Jämtland kallas på för att delta i arbetet. EFP är polisens arbetsmetod Efterforskning av försvunna personer.</p></p><p><p>Uppdatering 10:11<br />Enligt uppdaterat signalement så bar han inte glasögon vid försvinnandet. <br />En helikopter söker från luften.</p></p><p><p><strong>Uppdatering 15:24:</strong></p></p><p><p>Polisen dimensionerar resurserna för att på bästa sätt undsätta den försvunne. Vädret på plats är vackert, men kallt, och detta betyder att polisen måste ha rätt folk på rätt plats för att sökandet ska bli effektivt.</p></p><p><p>Polisen samarbetar med frivilligorganisationer och har en mycket god kontakt med Missing People. Sökandet sker både på mark och från luften. Försvaret är kontaktat och fjällräddare finns på plats.</p></p><p><p>Nya färska hundekipage från både fjällräddning och polisen är på väg.</p></p><p><p>Det finns vissa spår som man arbetar med och polisen kommer att gå ut med mer information när sådan finns att ge eftersom polisen behöver allmänhetens hjälp.</p></p><p><p><strong>Uppdatering 19:15:</strong></p></p><p><p>Den försvunne är återfunnen avliden. Anhöriga är underrättade.</p></p><p><p>Polisen misstänker inget brott i samband med dödsfallet.</p></p><p><p>Polisen tackar alla som hjälpt till i sökandet.</p></p><p><p>Uppdatering av Åsa Mjörndal, RLC-kommunikatör</p></p>",
        "content_teaser": "Pojken, som är i övre tonåren, är fortfarande försvunnen. \n Vid försvinnandet vid 20-tiden på torsdagen bar han en brun täckjacka med kapuschong, svarta täckbyx...",
