        "description": "Ett urval av nattens polisverksamhet.",
        "content": "<p>Klockan 22-07.30, det har varit en natt med normal arbetsbelastning. En person har medtagits för provtagning efter misstanke om narkotikabrott. Polisen har även utfört ett flertal kontroller av personer och fordon som inte resulterat i någon brottsmisstanke.</p>\n<p>Här följer ett urval av nattens händelser:</p>\n<p><strong>00:27 Rattfylleri, Luleå</strong><br />En patrull stoppade och kontrollerade en personbil på Hertsön. Föraren, en kvinna i 40-årsåldern, misstänktes vara påverkad och togs med för provtagning. Bilnycklarna omhändertogs med syfte att förhindra brott. En anmälan gällande misstänkt drograttfylleri upprättas.</p>\n<p><strong>02:18 Rattfylleri, Boden</strong><br />När en patrull skulle stoppa och kontrollera en personbil i Södra Svartbyn stannade inte föraren. Det blev ett kort förföljande innan föraren, en man i 25-årsåldern, stannade. Då misstanke om att han var påverkad av narkotika uppstod togs han med för provtagning. En anmälan upprättas gällande grovt rattfylleri alternativt rattfylleri och vårdslöshet i trafik, grov olovlig körning då föraren saknade körkort, ringa narkotika brott eget bruk och innehav, ringa dopingbrott innehav samt märkesförfalskning så fordonet hade registreringsskyltar som hörde till annat fordon. Bilen togs i beslag för att förebygga framtida trafikbrott. Mannen är anhållen.</p>\n<p><strong>02:38 Rattfylleri, Piteå</strong><br />En singelolycka med en personbil inträffade på Norrfjärden. Föraren, en man i 45-årsåldern misstänktes för rattfylleri och provtagning har skett. En anmälan gällande rattfylleri upprättas.</p>\n<p>En viltolycka har anmälts till polisen under natten och morgonen. Ingen person skadades i samband med olyckan.</p>",
