        "title_type": "Stöld",
        "title_location": "Norrtälje",
        "description": "Två män greps efter stöld av båtmotorer i Norrtälje.",
        "content": "<p>Polis påträffade två misstänkt stulna båtmotorer dolda intill en skogsväg i Norrtälje. Plötsligt dök ett fordon upp och lämnade av ytterligare en motor på platsen.</p>\n<p>I samband med att gärningsmännen i bilen försökte undkomma från platsen så valde fordonsföraren att köra rakt emot en civilklädd polis som försökte få stopp på fordonet. Polisen lyckades hoppa åt sidan och skadades inte. Gärningsmännens fordon blev senare prejade av vägen och de tre gärningsmännen avvek springandes från platsen.</p>\n<p>Efter spårning med hund och helikopter kunde två gärningsmän gripas. Händelsen rubriceras som grov stöld och försök till grov misshandel. De två som greps anhölls senare av åklagare.</p>",
