        "title_type": "Sammanfattning kväll och natt",
        "title_location": "Västra götalands län",
        "description": "Dagens presstalesperson är Christer Fuxborg och till kvällen kommer Ulla Brehm.",
        "content": "<p><strong>22.29 Alingsås, personrån.</strong><br /> En kille i 16 års åldern blir rånad på sin mobiltelefon, airpods samt sin jacka i Gråbo. Det var 7 stycken gärningsmän som hotade honom dock inte med något föremål. Rånarna som var maskerade försvann sedan från platsen. Polis sökte av närområdet men utan resultat.</p>\n<p><strong>23.29 Mariestad, narkotikabrott m.m.</strong><br /> Några personer kontrolleras i området Bråten och där påträffas knivar, misstänkt narkotika samt pepparspray i en bil som de färdades i.</p>\n<p><strong>00.15 Göteborg, skadegörelse genom brand.</strong><br /> Räddningstjänst får larm om att tre bilar brinner på Senapsgatan varför även polis åker med till platsen. Branden släcks och i skrivande stund är det oklart hur det hela började, ingen gripen.</p>\n<p><strong>02.47 Göteborg, inbrottsstöld.</strong><br /> En väktare befinner sig i närheten av Gamlestadstorget där man hör glaskross samt larmet går från Pressbyrån. Två tjuvar springer från platsen och väktaren efter. Tjuvarna hoppar in i en bil strax där på. Bilen kan stoppas en bit därifrån. Man kan konstatera att de varit inne på Pressbyrån och där stulet okänt antal tobaksvaror. Föraren av bilen kan även misstänkas för drograttfylleri samt medbrottslingen för narkotikabrott, eget bruk. Båda får följa med till stationen för vidare utredning.</p>\n<p><strong>03.22 Stenungsund, inbrottsstöld.</strong><br /> Vittne ser hur två tjuvar lämnar Strandvägen springandes i riktning mot Hasselbackevägen med två vita påsar. Man kan konstatera att det varit inbrott på restaurang Tiamo. Polis till platsen som påbörjar spårning med hund efter tjuvarna. Man hittar två vita påsar längs flyktvägen och de innehåller sprit i olika former. Inga tjuvar påträffas men en hel del spår har säkrats på brottsplatsen.</p>\n",
