        "description": "Skönsberg, bilist stoppad för kontroll",
        "content": "<p>Det visar sig att föraren, en man, har återkallat körkort och misstänks för olovlig körning. Han misstänks också för drograttfylleri och ringa narkotikabrott (eget bruk).</p>\n<p>Föraren och en passagerare, en kvinna, grips. De misstänks bland annat för stöld alternativt häleri.</p>\n<p>Bilen tas i beslag med stöd av trafikbrottslagen 7§. Det innebär att ett fordon som använts vid brott får förklaras förverkat, om det behövs för att förebygga fortsatt sådan brottslighet och förverkandet inte är uppenbart oskäligt.</p>\n<p>De två personerna hörs under eftermiddagen. De släpps på fri fot efter åklagarkontakt.</p>\n\n",
