        "content": "<p>En anmälare uppger att en tjej precis blivit rånad, av tre för dem okända gärningsmän. Genom att ha hotat henne med kniv och ett pistolliknande föremål, tvingar gärningsmännen till sig hennes jacka, samt en tröja. De springer därefter från platsen. Det finns inga uppgifter om att händelsen medfört några fysiska personskador.</p>\n<p>Polispatrull möter upp målsägande, och söker i området efter gärningsmännen.</p>\n<p>21.57 Polis har sökt i området med radiobil och hunbdpatrull, men någon gärningsman har inte anträffats.</p>",
