        "description": "Kvinna bestulen på surfplatta.",
        "content": "<p>20.34 Polisen fick samtal om att en kvinna hade blivit bestulen på en surfplatta. Det skulle ha skett cirka 20 minuter tidigare, utomhus vid en parkeringsplats på Aliforsgatan, nära korsningen med Julingatan i Torshälla.</p>\n<p>20.44 Polis på plats. </p>\n<p>21.15 Två unga män ska ha överraskat kvinnan bakifrån, tagit surfplattan, och sprungit från platsen. Den drabbade kvinnan är i 40-årsåldern. Händelsen är rubricerad som rån. </p>\n<p>Polisen har hållit förhör med den drabbade och sökt efter gärningspersonerna i området utan att hitta dem. Polisen har också sökt efter vittnen till händelsen. Om någon har sett något bör man ringa polisen på 114 14. Rånet ska alltså ha inträffat cirka 20.15.</p>",
