        "description": "Man med kniv, Rymdtorget.",
        "content": "<p>Polis skickas till Rymdtorget, där flera inringare uppger att en man går utomhus med en kniv. Mannen uppträder enligt uppgift påverkat. En man uppger att han blivit knivskuren av mannen, vilket ska ha skett i en lägenhet. Även ambulans skickas. </p>\n<p>15.29 Mannen med kniven är säkrad av polis på platsen.  </p>\n<p>15. 36 Polis är på plats hos målsägande i lägenheten, och kan konstatera att han har en sårskada på en arm.</p>\n<p>Händelsen utreds initialt som grov misshandel.</p>\n<p>16.01 Den skadade mannen är tillsedd av ambulans på plats, men har inte behövt att föras med för fortsatt vård. Förhör har hållits med honom. Den misstänkte mannen, som är i 45-års åldern, är gripen. Kniven har bar är tagen i beslag för den fortsatta utredningen.</p>\n<p>Händelsen rubriceras som försök till dråp.</p>\n\n\n",
