        "content": "<p>Under natten mot torsdagen har polisen hanterat 26 ärenden som rör Östergötlands län. Två personer har gripits för brott, se nedan, och fem personer har omhändertagits för fylleri eller provtagning. <br /><br /> 01:31 Misshandel, Norrköping. Polisen larmades till en bar på Prästgatan med anledning av en misshandel. Två personer ska ha slagit en tredje person och sedan lämnat platsen. Två personer som stämde in på signalementet kontrollerades av polis på Drottninggatan och de omhändertags för fylleri. De misstänks också för misshandeln. Den som misshandlades skadades inte allvarligt. <br /><br /> 01:55 Rån, Linköping. Polisen larmades efter att en person ska ha blivit misshandlad och slagen i sin lägenhet. Gärningspersonen tog den drabbades bilnyckel och mobiltelefon. Klockan 02:37 kontrollerade polisen en man i 25-årsålden som stämmer in på signalementet. Han greps misstänkt för rån. På platsen hittades även bilnycklarna. Den misstänkta fördes till polisstationen och en anmälan om rån och hemfridsbrott är upprättad. <br /><br /> 04:18 Stöld/inbrott, Motala. Polisen larmades till en förskola på Lustigkullevägen efter att en väktare hade upptäckt ett inbrott på en förskola. En man i 35-årsåldern kunde gripas i direkt anslutning till förskolan och han fördes till polisstationen. Det är oklart om något har stulits. En anmälan om stöld genom inbrott är upprättad.</p>",
        "content_formatted": "<p><p>Under natten mot torsdagen har polisen hanterat 26 ärenden som rör Östergötlands län. Två personer har gripits för brott, se nedan, och fem personer har omhändertagits för fylleri eller provtagning. <br /><br /> 01:31 Misshandel, Norrköping. Polisen larmades till en bar på Prästgatan med anledning av en misshandel. Två personer ska ha slagit en tredje person och sedan lämnat platsen. Två personer som stämde in på signalementet kontrollerades av polis på Drottninggatan och de omhändertags för fylleri. De misstänks också för misshandeln. Den som misshandlades skadades inte allvarligt. <br /><br /> 01:55 Rån, Linköping. Polisen larmades efter att en person ska ha blivit misshandlad och slagen i sin lägenhet. Gärningspersonen tog den drabbades bilnyckel och mobiltelefon. Klockan 02:37 kontrollerade polisen en man i 25-årsålden som stämmer in på signalementet. Han greps misstänkt för rån. På platsen hittades även bilnycklarna. Den misstänkta fördes till polisstationen och en anmälan om rån och hemfridsbrott är upprättad. <br /><br /> 04:18 Stöld/inbrott, Motala. Polisen larmades till en förskola på Lustigkullevägen efter att en väktare hade upptäckt ett inbrott på en förskola. En man i 35-årsåldern kunde gripas i direkt anslutning till förskolan och han fördes till polisstationen. Det är oklart om något har stulits. En anmälan om stöld genom inbrott är upprättad.</p></p>",
