        "content": "<p><strong>22.11 Halmstad, drograttfylleri.</strong><br />En patrull stannar och kontrollerar en bilist på Karl XI:s väg och där påvisar föraren tecken på drogpåverkan. Får följa med för provtagning, en anmälan skrivs.</p>\n<p><strong>05.13 Halmstad, Inbrottsstöld.</strong><br />Någon tar sig in i ett hus på Hallandsgatan via en olåst altandörr men blir upptäckt av en person som bor där. Tjuven lyckas dock få med sig en jacka och springer från platsen. Pappan i familjen springer efter tjuven men lyckas inte komma ikapp. Polis till platsen som söker av området men hittar inte på någon tjuv. Man tar upp en anmälan.</p>",
