        "title_location": "Västra götalands län",
        "description": "Dagens presstalesman är Christer Fuxborg och till kvällen kommer Anna Göransson.",
        "content": "<p><strong>02.07 Borås, stöld från lastbil.</strong><br /> Ett vittne ser hur tre personer håller på med något på en lastbil som står parkerad på en rastplats utmed Riksväg 40, Viared. Polis kallas fram till platsen och då har männen lämnat i en skåpbil. Patrullen stannar skåpbilen och där hittar man dunkar med diesel samt ”slangutrustning”. De tre personerna som åkte i skåpbilen grips och får följa med till stationen för förhör. Bilen tas i beslag med dess utrustning.</p>\n<p><strong>02.50 Falköping, grov misshandel.</strong><br /> En person blir knivskuren i magen på Järnvägsgatan av en för honom okänd person. Gärningsmannen försvinner sedan springandes mot Sten Sturegatan. Den knivskurne mannen som är i 20 års åldern körs med ambulans till sjukhus. Polis söker av närområdet men ingen person har påträffats som kan sättas i samband med händelsen. Enligt vittnen skall misshandeln skett helt oprovocerat. Ingen gripen och platsen spärras av för en teknisk undersökning. Vissa spår har säkrats på platsen.</p>\n<p><strong>03.31 Göteborg, rattfylleri m.m.</strong><br /> En patrull försöker stanna och kontrollera en moped med två personer på i området Gibraltargatan. Mopeden kör omkull och patrullen kan fånga in de båda personerna. Man hittar en kniv samt en batong på en av dem vilket tas i beslag. Föraren kan även misstänkas för rattfylleri samt saknar körkort. Föraren får följa med för provtagning, en anmälan skrivs.</p>\n<p><strong>05.37 Skara, trafikolycka.</strong><br /> En bilist kör av vägen på Riksväg 49 varför ambulans samt polis larmas till platsen. Föraren körs med ambulans till sjukhus i Skövde, oklar status. Det råder mycket svår halka på platsen som troligen har varit orsaken till avåkningen. </p>",
