const numDaysBetween = function (d1, d2) {
    var diff = Math.abs(d1 - d2);
    return diff / (1000 * 60 * 60 * 24);
};
export const lastWeeksCrimes = () => {
    const now = new Date();
    const pastweek = now.getTime() - (1000 * 60 * 60 * 24 * 7);
    return response.reduce((acc, cur) => {

        return ((numDaysBetween((cur.pubdate_unix * 1000), pastweek) >= 7) ? acc + 1 : acc);
    }, 0);
}

