//idag.
export const todaysCrimes = () => {
    let amount = 0;
    response.forEach(date => {
        if (isToday(parseFloat(date.pubdate_unix + '000'))) {
            amount += 1
        }
    })
    return amount
}

//senaste veckan
export const pastWeeksCrimes = () => {
    let amount = 0;
    response.forEach(date => {
        if (isThisWeek(parseFloat(date.pubdate_unix + '000'))) {
            amount += 1
        }
    })
    return amount
}

//senaste månaden
export const pastMonthsCrimes = () => {
    let amount = 0;
    response.forEach(date => {
        if (isThisMonth(parseFloat(date.pubdate_unix + '000'))) {
            amount += 1
        }
    })
    return amount
}
